import pytest
from server.for_bd_connect import DatabaseManager
import datetime
d = DatabaseManager()


# перед тестом мы создали пользователей в id 1 и с id 2
class TestDatabaseManager:
    @pytest.mark.parametrize(
        'username, password, gender, birthdate, ans',
        [(f'user{d.counting_users() + 1}', 'Test12345', True, '1999-12-12', d.counting_users() + 1),
         (f'user{d.counting_users() + 2}', 'Test1245', False, '1944-12-12', d.counting_users() + 2)]
    )
    def test_adding_user(self, username, password, gender, birthdate, ans):
        assert d.adding_user(username, password, gender, birthdate) == ans

    @pytest.mark.parametrize(
        'username, password, ans',
        [('user1', 'Test12345', 1),
         ('user2', 'Test1245', 2),
         ('user300', 'Test12345', -1)]
    )
    def test_checking_for_authorized_user(self, username, password, ans):
        assert d.checking_for_authorized_user(username, password) == ans

    @pytest.mark.parametrize(
        'ans',
        [2]
    )
    def test_counting_users(self, ans):
        assert d.counting_users() == ans

    @pytest.mark.parametrize(
        'user_id, ans',
        [(1, ('user1', True, datetime.date(1999, 12, 12))),
         (2, ('user2', False, datetime.date(1944, 12, 12)))]
    )
    def test_get_primary_data(self, user_id, ans):
        assert d.get_primary_data(user_id) == ans

    @pytest.mark.parametrize(
        'username, ans',
        [('user1', True),
         ('user2', True),
         ('user3000', False)]
    )
    def test_is_user_exists(self, username, ans):
        assert d.is_user_exists(username) == ans

    @pytest.mark.parametrize(
        'user_id, ans',
        [(1, ('User1', 'User1_l', '@test', '+7-999-999-99-99',  'test.png', 'test', 'Moscow')),
         (2, ('User2', 'User2_l', '@test2', '+7-999-999-99-98', 'test2.png', 'tesst2', 'Moscow'))]
    )
    def test_get_my_profile_data(self, user_id, ans):
        d.patch_user_profile_data(1, 'firstname', 'User1')
        d.patch_user_profile_data(2, 'firstname', 'User2')
        d.patch_user_profile_data(1, 'lastname', 'User1_l')
        d.patch_user_profile_data(2, 'lastname', 'User2_l')
        d.patch_user_profile_data(1, 'social', '@test')
        d.patch_user_profile_data(2, 'social', '@test2')
        d.patch_user_profile_data(1, 'phone_number', '+7-999-999-99-99')
        d.patch_user_profile_data(2, 'phone_number', '+7-999-999-99-98')
        d.patch_user_profile_data(1, 'photo_name', 'test.png')
        d.patch_user_profile_data(2, 'photo_name', 'test2.png')
        d.patch_user_profile_data(1, 'about_me', 'test')
        d.patch_user_profile_data(2, 'about_me', 'tesst2')
        d.patch_user_profile_data(1, 'location', 'Moscow')
        d.patch_user_profile_data(2, 'location', 'Moscow')
        assert d.get_my_profile_data(user_id) == ans

    @pytest.mark.parametrize(
        'user_id, ans',
        [(1, True),
         (2, True),
         (300, False),]
    )
    def test_is_user_exists_by_id(self, user_id, ans):
        assert d.is_user_exists_by_id(user_id) == ans

    @pytest.mark.parametrize(
        'user_id, ans',
        [(1, datetime.date(1999, 12, 12)),
         (2, datetime.date(1944, 12, 12)),
         (300, -1),]
    )
    def test_getting_birthdate(self, user_id, ans):
        assert d.getting_birthdate(user_id) == ans

